import{_ as a,a as l,o,af as t}from"./chunks/framework.BltrPXid.js";const p=JSON.parse('{"title":"常见问题集","description":"","frontmatter":{},"headers":[{"level":2,"title":"0. 正版验证失败","slug":"_0-正版验证失败","link":"#_0-正版验证失败","children":[]},{"level":2,"title":"1. 无法加入服务器","slug":"_1-无法加入服务器","link":"#_1-无法加入服务器","children":[]},{"level":2,"title":"2. 登录后变为新账号，或与原账号信息不匹配","slug":"_2-登录后变为新账号-或与原账号信息不匹配","link":"#_2-登录后变为新账号-或与原账号信息不匹配","children":[]},{"level":2,"title":"3. 在低版本客户端中，有些东西看起来和高版本不一样，或者发生了变化，让它们看起来很陌生","slug":"_3-在低版本客户端中-有些东西看起来和高版本不一样-或者发生了变化-让它们看起来很陌生","link":"#_3-在低版本客户端中-有些东西看起来和高版本不一样-或者发生了变化-让它们看起来很陌生","children":[]},{"level":2,"title":"4. 特性无法使用","slug":"_4-特性无法使用","link":"#_4-特性无法使用","children":[]},{"level":2,"title":"5. 连接异常断开","slug":"_5-连接异常断开","link":"#_5-连接异常断开","children":[]}],"relativePath":"guide/q&a.md","filePath":"guide/q&a.md","lastUpdated":1756628738000}'),d={name:"guide/q&a.md"};function r(i,e,c,n,_,h){return o(),l("div",null,[...e[0]||(e[0]=[t('<h1 id="常见问题集" tabindex="-1">常见问题集 <a class="header-anchor" href="#常见问题集" aria-label="Permalink to &quot;常见问题集&quot;">​</a></h1><h2 id="_0-正版验证失败" tabindex="-1">0. 正版验证失败 <a class="header-anchor" href="#_0-正版验证失败" aria-label="Permalink to &quot;0. 正版验证失败&quot;">​</a></h2><p>如果登录后提示「登入失败：身份验证目前正在停机维护」或类似消息，请检查您是否使用正版玩家名而非这个正版账户的所有者。如果是这样，您需使用另一个名字，并且为了彻底避免重名，可选择几个字的中文名登录服务器。</p><h2 id="_1-无法加入服务器" tabindex="-1">1. 无法加入服务器 <a class="header-anchor" href="#_1-无法加入服务器" aria-label="Permalink to &quot;1. 无法加入服务器&quot;">​</a></h2><p>这通常是多种原因导致的，例如 Mojang 正版验证服务无法连接、客户端版本不受支持等（请参见第五点获取更多信息）。</p><p>根据具体情况，我们才能确定问题原因。</p><h2 id="_2-登录后变为新账号-或与原账号信息不匹配" tabindex="-1">2. 登录后变为新账号，或与原账号信息不匹配 <a class="header-anchor" href="#_2-登录后变为新账号-或与原账号信息不匹配" aria-label="Permalink to &quot;2. 登录后变为新账号，或与原账号信息不匹配&quot;">​</a></h2><p>您可能不小心在启动器中登录了错误的用户名，或者您的用户名具有不同的 UUID 导致。如果是这样，请在您的启动器中登录正确的账号，或者检查 UUID 是否发生变化。</p><p>您也可能意外被服务器判定为了离线玩家，这种情况下，请执行 <code>/prem</code> 命令，这将会让服务器将您登记为正版玩家。如果您不具备正版账户，请绝不要执行这个命令，这会让您永久丢失访问权限，除非您联系管理员，否则这问题将不会得到解决。</p><h2 id="_3-在低版本客户端中-有些东西看起来和高版本不一样-或者发生了变化-让它们看起来很陌生" tabindex="-1">3. 在低版本客户端中，有些东西看起来和高版本不一样，或者发生了变化，让它们看起来很陌生 <a class="header-anchor" href="#_3-在低版本客户端中-有些东西看起来和高版本不一样-或者发生了变化-让它们看起来很陌生" aria-label="Permalink to &quot;3. 在低版本客户端中，有些东西看起来和高版本不一样，或者发生了变化，让它们看起来很陌生&quot;">​</a></h2><p>这种情况完全是因为您使用了低版本客户端。在理想情况下，您应当使用和服务器一致的版本，或者至少使用更高的版本。如果您是低版本玩家，那么 <code>Y≤0</code> 的地方是您无法访问的（低于 <code>1.17</code>）。我们理解您的选择，也为低版本提供了额外支持（使用木棍点击方块，或者是将准星对准方块执行 <code>/wt</code> 命令）。</p><p>如果您乐意游玩一个兼容性更好的服务器（即使版本更低），请告诉我们，以便我们决定。</p><h2 id="_4-特性无法使用" tabindex="-1">4. 特性无法使用 <a class="header-anchor" href="#_4-特性无法使用" aria-label="Permalink to &quot;4. 特性无法使用&quot;">​</a></h2><p>假设我们的客户端是 <code>foo</code> 版本，它能够使用 <code>bar</code> 特性。但我们的服务器始终保持最新正式版，它不存在 <code>bar</code> 特性，即使客户端是 <code>foo</code> 版本，但游戏内部逻辑是按照服务端执行的，所以完全没有办法。</p><p>但是如果 TNT 复制、地毯复制等基本特性不能使用，请向我们反馈。</p><h2 id="_5-连接异常断开" tabindex="-1">5. 连接异常断开 <a class="header-anchor" href="#_5-连接异常断开" aria-label="Permalink to &quot;5. 连接异常断开&quot;">​</a></h2><p>如果提示 <code>关掉梯子</code>，说明您使用的 IP 所在地不在我们的白名单内；如果提示 <code>连接异常</code>，说明服务器正在被假人攻击，请耐心等待一下（坐和放宽，O(∩_∩)O哈哈~）。如果遇到了这两种情况，联系我们，我们可以尽快为您提供帮助。</p>',17)])])}const u=a(d,[["render",r]]);export{p as __pageData,u as default};
